const LogoTray=()=> {
    return (
        <Logos>
            <ul>
                <li>
                    <ButtonStyle>
                        <button>
                            SCD
                        </button>                    
                    </ButtonStyle>
                </li>                

                <li>
                <ButtonStyle>
                    <button>
                        <img src={SCD_Cone} alt=""height='30' width='100'/>
